import React from 'react';
import { AboutContanier } from '../Aboutpage/About.elements';
import { 
    ContactWrap, 
    GetInTouchWrap, 
    GetInTouchHeading,
    GetInTouchText } from './Contact.elements';

const Contact = () => {
    return(
        <AboutContanier>
            <ContactWrap>
                <GetInTouchWrap>
                    <GetInTouchHeading>Get In Touch</GetInTouchHeading>
                    <GetInTouchText>Lorem ipsum dolor sit amet consectetur adipisicing elit. Maxime mollitia,
                        molestiae quas vel sint commodi repudiandae consequuntur voluptatum laborum
                        numquam blanditiis harum quisquam eius sed odit fugiat iusto fuga praesentium
                        optio, eaque rerum! Provident similique accusantium nemo autem. Veritatis
                        obcaecati tenetur iure eius earum ut molestias architecto voluptate aliquam</GetInTouchText>
                </GetInTouchWrap>
            </ContactWrap>
        </AboutContanier>
    )
}

export default Contact;
